        e.exports = JSON.parse('{"pages":{"odds-boost":{"metaTitle":"Odds Boosts | The Action Network","metaDescription":"See the boosted odds from every book in one place via The Action Network.","header":"Odds Boosts","description":"Odds boosts are simply regular bets offered at enticing odds. They\'re available to all customers, and there\'s no limit to how many you can bet. ","metaFAQ":[{"question":"<h2>What is an odds boost?</h2>","answer":"<p>An odds boost is a specific bet offered at a better price than normal. The <a href=\\"https://www.actionnetwork.com/online-sports-betting\\" target=\\"_blank\\" rel=\\"noopener\\">best online sportsbooks</a> post several odds boosts per day, giving you more advantageous odds on a particular market than you\'ll find elsewhere.</p>"},{"question":"<h2>Can you give me an example of an odds boost?</h2>","answer":"<p>Absolutely. Prior to the final round of the 2019 Masters, Tiger Woods was two shots behind leader Francesco Molinari and listed at 3-1 odds to win the tournament at <a href=\\"https://www.actionnetwork.com/online-sports-betting/reviews/draftkings\\" target=\\"_blank\\" rel=\\"noopener\\">DraftKings</a>. But the sportsbook decided to boost Tiger\u2019s odds up to 10-1 for both new and existing customers in <a href=\\"https://www.actionnetwork.com/online-sports-betting/new-jersey\\">New Jersey</a>. When Tiger went on to win the green jacket, DraftKings paid out $2.5 million to bettors.</p>"},{"question":"<h2>Where can I find odds boosts?</h2>","answer":"<p>You can find odds boosts right here on this page. Bookmark it -- or download our free app -- because we\'ll be curating the best odds boosts from legal sportsbooks every day.</p>"}],"_adminTags":["Odds Boosts"]},"home":{"metaTitle":"Action Network: Sports Betting Odds, News, Insights, & Analysis","metaDescription":"Action Network is the most trusted source for sports betting insights & analytics, improving your betting experience through data, tools, news & live odds across NFL, MLB and more."},"home_nfl":{"metaTitle":"NFL Betting News, Analysis & Insights | The Action Network","metaDescription":"Get NFL betting news, analysis and insights from The Action Network\'s football experts.","metaFAQ":[{"question":"<h3>How can I win betting on the NFL?</h3>","answer":"<p>The NFL is one of the hardest sports in the world to bet successfully because the lines are so accurate. The more popular a sport, the money in a betting pool, which results in sharper lines.</p><p>There are ways to win money betting the NFL, including <b>exploiting player props</b> that don\u2019t have as accurate of lines.</p><p>We try to leave no stone unturned when finding betting value, and our content reflects that. We cover props, weather, historical betting systems, mismatches in every game, market movement and more.</p>"},{"question":"<h3>What is a point spread in NFL betting?</h3>","answer":"A point spread is a <b>bet on the margin of victory.</b> If the Patriots are -7, that means they\u2019re favored by seven points and need to win by 8 points or more to win the bet. In that same game, the Jets would be +7, meaning they need to lose by 1-6 points or win the game to win the bet."},{"question":"<h3>What is a Total bet in an NFL game?</h3>","answer":"The total is a wager on the <b>total number of points scored in a game.</b> If the total in that Jets-Patriots game is 42, anyone who bets \u201cthe over\u201d would win if the two teams combine to score 43 points or more. Anyone who bet the under would win if they combine for 41 points or fewer. If it lands exactly on 42, it\u2019s a push and all bets are refunded."},{"question":"<h3>How do Moneylines work in NFL betting?</h3>","answer":"A moneyline is a <b>wager just on the winner of the game, adjusted for team strength.</b> Everything in American moneyline odds is based on winning $100 -- if the Patriots are -300, that means you need to risk $300 to win $100. If the Jets are +250, you\u2019ll win $250 if you risk $100. You don\u2019t have to bet $100, of course -- it scales up and down based on how much you want to bet. You can use our <a href=\\"https://www.actionnetwork.com/betting-calculators/betting-odds-converter\\">odds converter</a> to calculate moneyline winnings."}],"_adminTags":["League Page"]},"state-hub":{"metaTitle":"US Online Sports Betting and Legal Betting News","metaDescription":"Discover the best online sports betting sites and see which states offer legal sports betting. Take advantage of bonus offers from legal sportsbooks around the US.","header":"Where Online Sports Betting is Legal","_adminTags":["SBO"],"metaFAQ":[{"question":"<h3>What do you do when they come for you?</h3>","answer":"<p>You go to school and learn the golden rule</p>"}]},"state-review_new-jersey":{"metaFAQ":[{"question":"<h2>Do you have to live in New Jersey to bet online?</h2>","answer":"<p>Good news for those of you visiting the Garden State or New York City: You do not have to be a resident of New Jersey to place a legal sports bet. You simply have to be within state lines and you\u2019ll be allowed to create a betting account.</p>"},{"question":"<h2>Can I get rich betting in New Jersey?</h2>","answer":"try again"}],"_adminTags":["SBO"]},"book-review_fanduel":{"_adminTags":["SBO"],"metaFAQ":[{"question":"<h3> What is a Fanduel?</h3>","answer":"<p>A Fanduel is when two professional sports teams both choose one fan of their team to compete in single mortal combat with the other fan. The winner will be granted glory and free tickets to the next game</p>"}]},"best-lines":{"metaTitle":"Best Sports Betting Lines","metaDescription":"We display the best line on today\u2019s biggest sporting events so you can be sure you\u2019re getting the best price.","header":"Sports Betting Lines & Spreads","_adminTags":["Best Lines"]},"best-lines_nfl":{"metaTitle":"Best NFL Betting Lines & Spreads","metaDescription":"We display the best lines on every NFL game so you can get the best price.","header":"NFL Betting Lines & Spreads","_adminTags":["Best Lines"]},"odds_nfl":{"_adminTags":["Odds"],"metaFAQ":[{"question":"<h4>How fast can I lose all my money?</h4>","answer":"<p>In short, it depends. If you bet it all on your home team to win the superbowl then you\'ll probably lose it. Although, depending on when you bet on the superbowl it could take up to a year before you realize that loss.</p>"}]},"odds":{"_adminTags":["Odds"]},"public-betting_nfl":{"_adminTags":["Public Betting"]},"public-betting":{"_adminTags":["Public Betting"]},"expert-picks_nfl":{"_adminTags":["Expert Picks"]},"expert-picks":{"_adminTags":["Exprt Picks"]},"mlp_points-bet":{"OGTags":{"title":"BetSync Is Here! Automatically Sync Your Bets to the Action App","description":"Available to sports bettors in New Jersey, take advantage of PointsBet\'s latest offer and connect your account to your Action app","image":"https://assets.actionnetwork.com/322815_PointsBetBetSyncCreative.png"},"_adminTags":["MLP"]}}}')
